import MelodyGenerator from "./Portfolio-Items/MelodyGenerator";
import NanseaWebsite from "./Portfolio-Items/NanseaWebsite";
import Synth from "./Portfolio-Items/PopupGraphic";
const Projects = () => {
  return (
    <div>
      <div>
        <Synth />
      </div>
      <div className="Melody-Generator">
        <button>MELODY GENERATOR</button>
      </div>
      <div>
        <MelodyGenerator />
        <NanseaWebsite />
      </div>
    </div>
  );
};

export default Projects;
